    const pageStyles = {
        backgroundColor :  '#6bb8ce', // Set the background color to blue
        minHeight: '100vh', // Ensure the background color covers the entire viewport height
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
    };

    return (
        <div style={pageStyles}>
            <MyPage />
        </div>
    );
}

export default App;
